window.bookSummaryJSON = "<p><b>The city's golden girl falls heart first into a dark underworld.</b></p> <p>I want two things in life: to be the leading ballerina in my academy—</p> <p><i>And Max Butcher…</i></p> <p>A massive, tattooed boxer, and renowned thug.</p> <p>And my very first crush...</p> <p>I may be a silly little girl to him, but he's intent on protecting, possessing, and claiming me in every way—his little piece of purity.</p> <p>But there is more to Max Butcher than the cold, cruel facade he wears like armour. I know; I saw the broken boy inside him one day when we were only children.</p> <p>So, even as I stand in the shadows with him, as people get hurt... as people die… I refuse to let him believe he's nothing more than a piece in his Family's corrupt empire.</p> <p>There is good inside Max Butcher, and I refuse to let him live in the dark forever.</p> <p><i>Our Thing is book one in The Kids of The District series and has a happily for now with part two live. Part two has a happily ever after. This book features a powerful and moody hero and an endearing and determined heroine. Both main characters are possessive and fight for each other. It is a love story, with spice, steam, violence, and drama. Enjoy.</i></p>"; 
